import React, { useEffect, useState } from 'react'
import Layouts from '../../Layouts/Layouts'
import { useLoginManager } from '../../StateManagement/UserManagement';
import { useNavigate } from 'react-router-dom';
function ProjectToGuide() {
    const{userID} = useLoginManager();
    const navigate = useNavigate();
    const [data,setData] = useState();

    useEffect(()=>{
      const getData = ()=>{
        try{
            const response  = axios.get(`http://localhost:3001/t/guideProjects/${userID}`);
            setData(response.data);
        }
        catch(error)
        {  
            console.log(error);
        }
      }
      getData();
    },[])
  return (
    <Layouts>
        {data.map((data,index))}
    </Layouts>
  )
}

export default ProjectToGuide
